#recent-work {
  .recent-work--header {
    .work-filter-nav {
      margin-bottom: 5rem;
      display: flex;
      flex: 1;
      justify-content: center;

      &__item {
        .btn-filter {
          text-transform: uppercase;
          font-size: 1.4rem;
          padding: 0.5rem 1.5rem;
          color: $color-secondary-light;
          border: none;
          background: transparent;
          cursor: pointer;
          outline: none;
          display: flex;
          align-items: center;
          justify-content: center;

          &:hover {
            color: $color-primary;
          }
        }

        .btn-active {
          color: $color-primary;

        }
      }
    }
  }

  .recent-work--gallery {
    width: 100%;
    display: none;
    flex-flow: row wrap;
    justify-content: center;
    display: flex;


    .gallery-itme {
      position: relative;
      z-index: 1;
      overflow: hidden;
      cursor: pointer;



      height: 0;
      width: 0;
      @include AOS-scale-out-sm;
      @include AOS-transition-transformCubicBezier-md;

      &:hover {
        .gallery-item__overlay {
          opacity: 1;

          .overlay-info {
            bottom: 4rem;
          }
        }
      }
    }

    .work-visible {
      display: block;
      @include AOS-scale-stop;
      width: 25%;
      height: auto;

      // on small screen device: ipad
      @include respond-mediaQuery(ipad) {
        width: 40%;
      }

      // on small screen device: phone
      @include respond-mediaQuery(phone) {
        width: 40%;
        height: 20rem;

        .gallery-item__img img {
          height: auto;
        }
      }
    }

    .gallery-item__img {
      height: 30rem !important;
      overflow: hidden;

      img {
        width: 100%;
        height: 100%;
        vertical-align: text-bottom;
      }
    }

    .gallery-item__overlay {
      position: absolute;
      top: 3%;
      left: 3%;
      background: linear-gradient(rgba($color-primary, 0.9),
          rgba($color-primary, 0.9));
      height: 94%;
      width: 94%;
      z-index: 2;
      padding: 4rem;
      box-sizing: border-box;
      opacity: 0;
      @include transition-delay-md;

      .overlay-info {
        position: absolute;
        bottom: 1rem;
        @include transition-delay-md;
      }

      .overlay-info--title {
        color: $color-white-primary;
        margin-bottom: 1rem;
      }

      .overlay-info--section {
        font-size: 1.3rem;
        color: $color-white-primary;
      }
    }
  }

  // FOR ANIMATION ON-SCROLL
  .recent-work--gallery {

    @include AOS-fade-right-md;
    @include AOS-transition-transformCubicBezier-md;

    &.visible {
      @include AOS-fade-stop;
    }
  }
}

// POPUP GALLERY 
#selected-work-popup-box {
  position: fixed;
  z-index: 200;
  height: 100vh;
  width: 100%;
  top: 0;
  left: 0;
  background-color: rgba($color-white-secondary, 0.5);
  backdrop-filter: blur(10px);
  @include AOS-scale-out-sm;
  @include transition-delay-sm;
  opacity: 0;


  &.visible-popup-box {
    @include AOS-scale-stop;
    opacity: 1;
  }

  .selected-work {
    position: absolute;
    z-index: 300;
    left: 50%;
    top: 50%;
    width: 40%;
    padding: 5rem;
    background: $color-white-primary;
    @include transform-xy-minus50percent;
    @include box-shadow--primary;



    // on small screen device: phone
    @include respond-mediaQuery(ipad-pro) {
      width: 90%;
    }

    &__title {
      margin-bottom: 2.5rem;
      font-size: 2.3rem;
      color: $color-black-secondary;
    }

    &__para {
      line-height: 2.5rem;
      font-size: 1.7rem;
      margin-bottom: 3rem;
      color: $color-secondary;
    }

    &__image {
      width: 100%;

      img {
        width: 100%;
      }
    }

    .close-popup-box {
      position: absolute;
      z-index: 400;
      font-size: 2.2rem;
      cursor: pointer;
      right: 3.1rem;
      top: 3.1rem;
      background: $color-white-primary;
      border: none;
      border-radius: 50%;
      height: 5rem;
      width: 5rem;
      padding: 0.9rem;
      outline: none;
      @include box-shadow--primary;

      &:hover {
        opacity: 0.75;
      }
    }
  }
}

